    /**
     * 根据卡号获得银行信息
     * @param bankCardNumber
     * @return 
     */
    public static BankCardType getBankCardTypeByNumber(String bankCardNumber) {
        if (StringUtils.isEmpty(bankCardNumber) && bankCardNumber.length() < 10) {
            return null;
        }

        Set<String> bins = bankCardTypeMap.keySet();
        for (String bin : bins) {
            if (bankCardNumber.startsWith(bin)) {
                return bankCardTypeMap.get(bin);
            }
        }

        return null;
    }
